import React from 'react';
import './Header.css';


export default function Header(props)
{
    document.getElementsByClassName('nav-container')[0].style.height = 200;
    return (
        <div className="header-container">
                <img src={props.src} alt="Druzyna spr bor"></img>
                <h1>{props.text}</h1>
        </div>
    );
}
